import React from 'react';

import './Todo.css';
import { List, ListItem, ListItemText} from '@material-ui/core';

function Todo(props){
  return (
    <List className='todo_list'>
      <ListItem>
        <ListItemText primary="Todo" secondary={props.text} />
      </ListItem>
    </List>
  )
}

export default Todo
